script: |
  super -f text -I q211.spq | sort > q211.out

inputs:
  - name: q211.spq
    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) WHERE NOT col2 * + col2 NOT BETWEEN + ( + - col2 ) - + + col1 AND 19 + col1 + + 50 * + 12;
  - name: tab2

outputs:
  - name: q211.out
    data: |
      46	51	23
